    false,nt"url": null,nt"notes": "Using a LH Systems ALS50 Light Detection
    And Ranging (LiDAR) system, 43 flight lines of standard density (1.4 meter ground
    sample distance) data were collected over areas in Orange County, TX (approximately
    364 square miles). Multiple returns were recorded for each laser pulse along with
    an intensity value for each return. The data acquisition occurred in 5 missions
    between June 4, 2006, and June 6, 2006. The data was collected by Sanborn Mapping
    Company, Inc. for the Texas Water Development Board (TWDB) and the Federal Emergency
    Management Agency (FEMA).",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
